library AtropaMath  {
    uint64 constant public MotzkinPrime = 953467954114363;

   // RNG private RandomNumberGeneratorToken;

    // ERC20 private DaiToken;
    // ERC20 private USDCToken;
    // ERC20 private USDTToken;
    // ERC20 private G5Token;
